const PaymentForm = () => {
    return (
        <PaymentFormContainer>
            <CardElement />
            <Button buttonType={BUTTON_TYPE_CLASSES.inverted}> Pay Now </Button>
        </PaymentFormContainer>
    );
};

export default PaymentForm;
